This is a Java problem. After JDK 1.3 you cannot access types in the default package from a type that isn't. The following example will only compile (even in a vanilla Java project) when using "Compiler compliance leve: 1.3" (but won't with javac unless you are actually using JDK 1.3 not "-src 1.3"):

public interface Interface {
}


package user;
import Interface;
public class Caller implements Interface {
}

I have checked the ICU4J source code.It seems that there is a mistake in DecimalFormat Class. When use NumberFormat.getInstance(locale) to get DecimalFormat instance, It will get one from ICULocaleService and then clone this one.DecimalFormat has a DigitList variable.When clone DecimalFormat, the DigitList var isn't renewed.Please check the following code:

     /**
     * Standard override; no change in semantics.
     * @stable ICU 2.0
     */
    public Object clone() {
        try {
            DecimalFormat other = (DecimalFormat) super.clone();
            other.symbols = (DecimalFormatSymbols) symbols.clone();
            other.digitList = new DigitList();
            return other;
        } catch (Exception e) {
            throw new InternalError();
        }
    }

I have added a new line: other.digitList = new DigitList();
Done test again. It worked well.

So this bug should depend on ICU4J issue.

