Hi,
I'm using cross compiler that generates ELF binary on Windows. The GNU ELF binary parser is turned ON, other binary parsers are OFF. When expanding the binary file in order to see the symbols list (clicking on [+] next to the file), the IDE hangs and UI stops responding. 
Debugging shows that "read_unsigned_leb128" function in DwarfReader.java enters infinite loop. The file is located in org.eclipse.cdt.core plugin in package org.eclipse.cdt.utils.debug.dwarf. My fix proposal below is based on the official CDT 3.1 sources, with the changed lines marked by asterisks:

long read_unsigned_leb128(byte[] data, int offset) throws IOException {
		/* unsigned */
		long result = 0;
		int shift = 0;
		short b;

		m_leb128Size = 0;
		while (true) {
(*)			b = (short) data[offset++];
(*)			if (data.length == offset)
				break; //throw new IOException("no more data");
			m_leb128Size++;
			result |= ((long) (b & 0x7f) << shift);
			if ((b & 0x80) == 0) {
				break;
			}
			shift += 7;
		}

		return result;
	}

The fix is based on similar implementation in Dwarf.java.
